script: |
  super -f tsv -I q8925.sql | sort > q8925.out

vector: true

inputs:
  - name: q8925.sql
    data: |
      SELECT - col2 / - col0 - col0 AS col0 FROM tab1 AS cor0 WHERE + col2 * - 17 NOT IN ( col0 * + ( + CAST ( col2 AS INTEGER ) / + 40 ) + 66 * 60 );
  - name: tab1

outputs:
  - name: q8925.out
    data: |
      -50
      -85
      -91
